import React, { useState, useEffect} from 'react';
import './resume_result.css'
import { useLocation, useNavigate } from 'react-router-dom';
import axios from "axios";

const ResumeResult = (props) => {

  const location = useLocation();
  console.log(location.state);
  const [responseNum, setResponseNum] = useState(null);

    const callApi = async()=>{
      try {
        const response = await axios.get("/api/resume_result",{params: {keyword: location.state} },
        { withCredentials: true } );
        setResponseNum(response.data.number);
        //console.log(response.data.number);

      } catch (error) {
        console.error("Error fetching data:", error);
      }

    };

    useEffect(()=>{
      callApi();
    }, []);

    const navigate = useNavigate();

    const handleLogout = () => {
      navigate('/');
    };
    const handleHome = () => {
      navigate('/home');
    };
    const handleSearchResume = () => {
      navigate('/searchResume');
    };
    const handleSearchNotice = () => {
      navigate('/searchNotice');
    };
    // const handleResume = () => {
    //   navigate('/resume');
    // };
    // const handleNotice = () => {
    //   navigate('/notice');
    // };
    const handleSelectResume = () => {
      navigate('/selectedResume');
    };
    const handleResumeResult = () => {
      navigate('/resumeResult');
    };
    // const handleNextPage = () => {
    //   navigate('/resumeResult');
